window.bookSummaryJSON = "<p><b><i>Play dangerous games… win dangerous prizes.</i></b></p> <p>It starts with revenge.</p> <p>A decade ago, I embraced death–or so they believe.</p> <p>It’s my life’s mission to make the Lords of Darkness pay for their actions.</p> <p>A perfectly-timed opportunity propels me into the heart of the malevolent order that shattered my very existence.</p> <p>From the smoldering ruins of the Lords of Darkness emerges the Princes of Sin: a secret brotherhood with fresh faces and dark desires—myself included.</p> <p>I slither through the shadows–<i>a viper biding its time to strike.</i></p> <p>But the four other Princes of Sin soon become distractions, each with their own captivating mysteries.</p> <p>Most importantly, I've overlooked a crucial truth: the Lords of Darkness are omniscient, and their retribution looms.</p> <p>Never betray your brethren–and never never underestimate the power of the Lords.</p> <p>I’m no longer looking for revenge.</p> <p>I’m only looking to <i>survive</i>.</p> <p><b><i>Princes of Sin</i></b><b> is book three in a dark why choose romance series. It is a spin-off of the first two books, and the characters do overlap. Please note: this book is a standalone, but it is suggested you listen to it after the first two books in the series. Please proceed with caution and heed the trigger warnings. Your mental health matters.</b></p>"; 
